import React from "react";

const Footer = () => {
  return (
    <footer
      style={{
        textAlign: "center",
        fontSize: "1rem",
        bottom: "0",
        position: "fixed",
      }}
    >
      <a href='https://github.com/cnr-mtsn/rona'>cnr_mtsn</a>
    </footer>
  );
};

export default Footer;
